import Head from 'next'

function HomePage() {
  return (
    <div>
      <img
        src="/unicorngundam.webp"
        alt="Unicorn Gundam"
        className="homeimage"
      ></img>
      <h1>Welcome to my Dev Blog</h1>
      <p>
        Learn more about me <Link href="/about">here</Link>
      </p>
    </div>
  );
}

export default HomePage;
